B.aqL=new A.cD(" they can implement across their ward. They can choose to spend money on projects that aren\u2019t on the list too. It is entirely up to alder\u2019s discretion on how and where they spend their menu funds, but some alders choose to involve the community through participatory budgeting.",null,null,B.Y,null)
B.aqM=new A.cD("Participatory budgeting (PB) is a practice having the community directly decide how to spend public budgets. A typical PB process goes like this:\n        1. Residents submit PB project ideas\n        2. A group of volunteers evaluates the ideas based on need and feasibility\n        3. Residents vote on the final list of ideas to determine which ideas get funding\n        4. The ward office works with CDOT to implement the winning project ideas\n\nOnly a handful wards currently use PB budgeting, but that number is growing. \nLearn more about participatory budgeting in Chicago here: ",null,null,B.Y,null)
