B.aqQ=new A.cD("Sure! Our data analysis and website source code are ",null,null,B.Y,null)
B.aqR=new A.cD("Since 2012, the Chicago Office of Budget and Management has published PDFs of itemized aldermanic menu spending to their ",null,null,B.Y,null)
B.aqS=new A.cD(". We hope to incorporate that data into our site in the near future.\n\nThe standard menu item descriptions and cost information comes from the 2023 Neighborhood Infrastructure Menu Program packet that was sent out to ward offices.\n                  ",null,null,B.Y,null)
B.aqU=new A.cD("Menu items that make streets safer are denoted with the Vision Zero logo in the menu item list. Vision Zero is an effort to bring the number of yearly traffic fatalities down to zero. You can learn more here: ",null,null,B.Y,null)
B.aqV=new A.cD("The city of Chicago is divided into 50 legislative areas, called \u201cwards\u201d. Each ward contains roughly 50,000 residents and can overlap with multiple neighborhoods. Ward boundaries are redrawn every 8 years and were last redrawn in 2023.\n\nSee the list of wards:\n",null,null,B.Y,null)
B.aqX=new A.cD(". Our site is using raw data extracted from these PDFs by journalist ",null,null,B.Y,null)
B.aqZ=new A.cD(".\n\nResearcher John C. Ruf submitted a FOIA request to get aldermanic spending data going back to 2005. Those PDFs are available ",null,null,B.Y,null)
B.ar0=new A.cD("\u201cEvery year, the City of Chicago allocates 'menu money' to each of the 50 alders to spend at their discretion on capital improvements within their ward. In the past, alders received $1.32 million a year. In 2021, the amount increased to $1.5 million.\n    Menu money funds can only be spent on capital projects and not operating costs; for example, they can fund a public bench or street repaving, but it cannot fund an after-school program or snacks. Most broadly, the money can be spent on infrastructure projects on public land. This budget is the main source of funding local infrastructure improvements like:\n         - street repaving\n         - pedestrian safety projects\n         - lighting\n         - traffic calming, and\n         - sidewalk repairs\n\u201d\nSource: ",null,null,B.Y,null)
B.ar2=new A.cD("Alders are provided ",null,null,B.Y,null)
B.ar3=new A.cD("Each ward elects an alder, who is essentially a mini-mayor. They provide ward services and vote on citywide legislation in the Chicago City Council.\n\nLearn more about what an alder does:\n",null,null,B.Y,null)
